window.bookSummaryJSON = "<p><b>All’s fair in love and...the apocalypse?</b></p> <p>With the war looming, Jade Blackwell knows the odds aren’t really in Heaven’s favor. The demons have built an army far greater than the angels’, and things aren’t looking good. When Jade decides it’s time to look for recruits, she goes against Michael’s orders and touches down on earth. Problem is, she doesn’t know where to start.</p> <p>Cue Cole Masters, the devilish half-demon Jade has struggled to get out of her head since their first encounter all those months ago. Because of his long list of supernatural contacts, he knows just the people to join their cause. However, with Cole’s demon-half hovering too close to the surface, Jade can’t help but wonder whose side he’s actually on.</p> <p>Despite all the risks, Jade must find a way to get all supernaturals, and even humans, to fight for their lives. But when the war begins and Hell rises, she soon realizes she may not be able to save everyone - including the man she loves.</p>"; 
